  3,\n\t\"tags\": [],\n\t\"title\": \"2005-2006 Southwest Florida Water Management
  District (SWFWMD) Lidar: Polk County (Including Hampton, Judy, Lake Wales, Peace
  River (North), and Polk District Remainder Tracts)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
